import React from 'react';
import styled from 'styled-components';

const SideMenuContainer = styled.div`
  position: fixed;
  left: ${props => props.isOpen ? '0' : '-70%'};
  top: 0;
  width: 70%;
  height: 100%;
  background-color: #FFD700;
  transition: left 0.3s ease-in-out;
  z-index: 1000;
`;

const MenuList = styled.ul`
  list-style-type: none;
  padding: 20px;
`;

const MenuItem = styled.li`
  margin-bottom: 15px;
  font-size: 18px;
  color: #333;
`;

const SideMenu = ({ isOpen }) => (
  <SideMenuContainer isOpen={isOpen}>
    <MenuList>
      <MenuItem>해외 여행</MenuItem>
      <MenuItem>워킹 홀리데이</MenuItem>
      <MenuItem>어학 연수</MenuItem>
      <MenuItem>해외 취업</MenuItem>
      <MenuItem>출국 전 정보</MenuItem>
      <MenuItem>해외 생활 정보</MenuItem>
      <MenuItem>귀국 전 정보</MenuItem>
      <MenuItem>공동 구매</MenuItem>
    </MenuList>
  </SideMenuContainer>
);

export default SideMenu;
